One problem with using Irmin.Contents.Json.t is that we've lost the richness of the OCaml type system to a certain extent. This means it isn't obvious what are store is actually storing. Is it random JSON objects or a serialisation of a more rich OCaml value? If it is the latter, it probably isn't the interface we want. For example, consider the following simple message datatype. module type Message = sig type t = string [@@deriving irmin] include Irmin.Contents.S with type t := t
end module Message : Message = struct type t = string [@@deriving irmin] let merge ~old:_ a b = match String.compare a b with | 0 -> if Irmin.Type.(unstage (equal t)) a b then Irmin.Merge.ok a else let msg = "Conflicting entries have the same timestamp but different values" in Irmin.Merge.conflict "%s" msg | 1 -> Irmin.Merge.ok a | _ -> Irmin.Merge.ok b let merge = Irmin.Merge.(option (v t merge))
end By default if we create a store with this content type, the data will be stored using the string representation defined in repr . For the most part this is actually quite JSON-like. # Irmin.Type.to_string Message.t "Hello World";;
- : string = "Hello World" But there is an actual JSON-backend to the representation. # Irmin.Type.to_json_string Message.t "Hello World";;
- : string = "\"Hello World\"" In fact for the most part the encoding does use JSON to format the OCaml values. The difference are usually very subtle, for example OCaml strings are just bytes whereas for JSON they must be UTF-8. So we can get very different formats (or as above where the JSON string requires the inverted-commas). let _no_output_because_utf8 = Irmin.Type.to_string Message.t "\xc3\x28" Whereas we must convert to a UTF-8 string that we can serialise and deserialise. # Irmin.Type.to_json_string Message.t "\xc3\x28";;
- : string = "{\"base64\":\"wyg=\"}" Fortunately, we can override the runtime representation of the type Irmin uses to store the values and keep the richness of the actual type when programming with the Irmin interface, but be serialising the data into JSON values. This is particularly useful, for example, with the Git.FS backend to read and write JSON values in Git stores. module Message_json : Message = struct type t = string [@@deriving irmin] let merge ~old:_ a b = match String.compare a b with | 0 -> if Irmin.Type.(unstage (equal t)) a b then Irmin.Merge.ok a else let msg = "Conflicting entries have the same timestamp but different values" in Irmin.Merge.conflict "%s" msg | 1 -> Irmin.Merge.ok a | _ -> Irmin.Merge.ok b let t = Irmin.(Type.like ~pp:(Type.pp_json t) ~of_string:(Type.of_json_string t) t) let merge = Irmin.Merge.(option (v t merge))
end

