Because so many modules and functions expect a runtime type, Irmin provides a ppx that can in the majority of cases derive the runtime representation of your type for you. # type t = { name : string }[@@deriving irmin];;
type t = { name : string; }
val t : t Repr.ty = <abstr> You can see that this created a value called t (not to be confused with the type itself). # Irmin.Type.to_string t { name = "Bob" };;
- : string = "{\"name\":\"Bob\"}" You can also build up representations of more complex types using the built-in combinators. # let t = Irmin.Type.(list (pair string (option int)));;
val t : (string * int option) list Repr.ty = <abstr>
